import React, { useRef } from 'react';
import { Container } from './styles';
import { Input, Button } from '@material-ui/core';
import axios from 'axios';

const serverUrl = 'http://localhost:3001'; 

const Register = () => {
	const nameRef = useRef();
	const emailRef = useRef();
	const passwordRef = useRef();

	const handleSubmit =() => {
		const email = emailRef.current.value;
		const passwordRef = passwordRef.current.value;
		const name = nameRef.current.value;
		const response = axios.post( serverUrl + '/register'); 
		response.then((data) => console.log(data)).catch((E))
	}
return (
	<Container>
		<Input placeholder="Enter name" name="name" ref={nameRef} /><br />
		<Input placeholder="Enter email" name="email" ref={emailRef} /><br />
		<Input placeholder="Enter password" name="email" ref={passwordRef} type="password" /><br /><br />
		<Button variant="contained" color="primary" onClick={() => handleSubmit()}>Register</Button>
	</Container>
  )
}
export default Register ;
